
<DOCTYPE HTML>
<head>
  <title></title>
  <meta charset="utf-8"/>
  <meta http-equiv="X-UA-Compatible" content="IE=edge"/>
  <meta name="viewport" content="width=device-width, initial-scale=1"/>
  <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/3.2.0/css/bootstrap.min.css">
  <link href="http://maxcdn.bootstrapcdn.com/font-awesome/4.2.0/css/font-awesome.min.css" rel="stylesheet">
<link href="css/style.css" rel="stylesheet">
<link href="css/simple-slider.css" rel="stylesheet">
</head>
<body>
  <div class="container">
   <h2>SocialCounter - Dashboard</h2>
     <div class="col-8-sm dashboard-main">
        <div class="main-container">
          <script id="social-tpl" type="text/x-handlebars-template">
            <div class="social-data-block">
             <p>{{createdAt}}test</p>
             <p>{{twitter}}</p>
             <p>{{linkedin}}</p>
             <p>{{stackoverflow}}</p>
             <p>{{angellist}}</p>
            </div>
          </script>
     </div>
  </div>
  <script src="https://ajax.googleapis.com/ajax/libs/jquery/1.11.1/jquery.min.js"></script>
  <script src="https://maxcdn.bootstrapcdn.com/bootstrap/3.2.0/js/bootstrap.min.js"></script>
  <script src="http://builds.handlebarsjs.com.s3.amazonaws.com/handlebars-v2.0.0.js"></script>
  <script src="//www.parsecdn.com/js/parse-1.3.1.min.js"></script>
  <script src="js/script.js"></script> 
  <script src="js/dashboard.js"></script>
  <script src="js/simple-slider.min.js"></script>
  <script type="text/javascript" src="https://www.google.com/jsapi"></script>

</body>
</html>
